import './GalleryScroll.css'


function GalleryScroll(props) {

    const { children, images, ...other } = props;

    return (
        <div style={{display: 'flex', alignItems: 'center'}}>
            <div id='slider' style={{ width: "100%", height: '50%', overflow: "auto", display: "flex" }}>
                <img src={images} alt={'Test'} style={{font: 'white'}} className='styled-img' />
            </div>
        </div>
    );
}

export default GalleryScroll;
